import React from "react";
import './App.css';





function Play(props) {
    let {cartoons} = props;

  return (
   cartoons.map((item) => (
    <div id={item.title}>
     <img src={item.src} />
     <h1>{}</h1>
    </div>
   ))
  )
}

export default Play;
